import React from "react";
import styled from "styled-components";

// const BtnWrap = styled.div`
//   width: 17rem;
//   height: 4rem;
// `;
const EffectDiv = styled.div`
    width:17rem;
    height: 4rem;
  box-shadow: 3.5px 4px 5px #750BC9;
  border-radius: 50px;
`;
const Btn = styled.div`
  width:17rem;
    height: 4rem;
  /* line-height: 4rem; */
  font-size: 1.5rem;
  margin: 1rem;
  background-color: #fff;
  border-radius: 50px;
`;
export const StartBtn = () => {
  return (
    // <BtnWrap>
      <EffectDiv>
        <Btn>Start</Btn>
      </EffectDiv>

  );
};

export const AccountBtn = () => {
  return (
    <EffectDiv>
      <Btn>회원가입/로그인</Btn>
    </EffectDiv>
  );
};
